import { useEffect, useState, useContext } from 'react';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { BASEURL } from './baseURL';
import { Card, Container, Row, Col } from 'react-bootstrap';
import { AppContext } from './App';
import { useNavigate, Link } from 'react-router-dom';



function DoctorSlotList( {slotList, setSlotList} ) {

  const {isDoctor, setIsDoctor, doctorId, setSelectedPatient} = useContext(AppContext);
  const navigate = useNavigate();
  
  useEffect(()=>{
    const callSlotList = async() =>{
      try{
        const response = await axios.get(BASEURL + `/profile/book_slots_list/${doctorId}`);
        console.log(response.data);
        setSlotList(response.data);
      }
      catch(error){
        console.error(error);
      }}
      callSlotList();
  }, [doctorId]);

  return (
    <Container className="m-1">
    <Row>
    <ul className="list-unstyled">
    <div className="d-flex justify-content-center">
    <div className="d-flex">
      {slotList.map((slot) =>(
        <li key={slot.id}>
          <Card className="mb-4">
          <Card.Title tag="h5">{slot.patientProfile? slot.patientProfile.name : "Not Booked"}</Card.Title>
          <Card.Text>{slot.booking_date}</Card.Text>
          <Card.Text>{slot.start_time}</Card.Text>
          <Card.Text>{slot.end_time}</Card.Text>
          
          {slot.patientProfile &&
            <Button
            variant="primary"
            className="custom-btn mr-2" 
            type="button"
            onClick={(e) => {
              e.preventDefault();
              setSelectedPatient(slot.patientProfile.id);
              navigate("/patient_detail");
              }}>
              See Details
              </Button>
            }
            {slot.patientProfile &&
              <Button
              variant="primary"
              className="custom-btn" 
              type="button"
              onClick={(e) => {
                e.preventDefault();
              }}>
                Call
            </Button>
            }
            
          
          </Card>
        </li>
      ))}
    </div>
    </div>
    </ul>
    </Row>
    </Container>
  )
}

export default DoctorSlotList
